def hydrate_time(nanoseconds, tz=None):
    epoch = datetime(1970, 1, 1, tzinfo=timezone.utc)
    delta = timedelta(microseconds=nanoseconds // 1000)
    dt = epoch + delta
    if tz is not None:
        dt = dt.astimezone(tz)
    return dt.time().strftime("%H:%M:%S.%f")

