def cached(cache, key=hashkey, lock=None):
    def decorator(func):
        @functools.wraps(func)
        def wrapper(*args, **kwargs):
            k = key(func, *args, **kwargs)
            if k in cache:
                return cache[k]
            if lock is not None:
