def ttl_cache(maxsize=128, ttl=600, timer=time.monotonic, typed=False):
    """
    Decorator to wrap a function with a memoizing callable that saves
    up to `maxsize` results based on a Least Recently Used (LRU)
    algorithm with a per-item time-to-live (TTL) value.
    """
    def decorating_function(user_function):
        cache = collections.OrderedDict()

        def _make_key(args, kwds):
            items = []
            items.extend(args)
            if kwds:
                items.extend(sorted(kwds.items()))
            if typed:
                types = []
                for arg in args:
                    types.append(type(arg))
                if kwds:
                    for k, v in sorted(kwds.items()):
                        types.append(type(v))
                items.append(tuple(types))
            return tuple(items)

        @wraps(user_function)
        def wrapper(*args, **kwds):
            key = _make_key(args, kwds)
            now = timer()
            if key in cache:
                value, expires = cache[key]
                if now < expires:
                    del cache[key]
                    cache[key] = (value, expires)
                    return value
                else:
                    del cache[key]
            result = user_function(*args, **kwds)
            expires = now + ttl
            cache[key] = (result, expires)
            while len(cache) > maxsize:
                oldest_key = next(iter(cache))
                del cache[oldest_key]
            return result
        return wrapper
    return decorating_function

import collections

def lru_cache(maxsize=128, typed=False):
    def decorating_function(user_function):
        if maxsize == 0:
            return user_function
        class LRUWrapper:
            def __init__(self):
                self.user_function = user_function
                self.cache = collections.OrderedDict()
                self.maxsize = maxsize
                self.typed = typed
                self.hits = 0
                self.misses = 0
            def __call__(self, *args, **kwds):
                key_args = args
                key_kwargs = sorted(kwds.items())
                if self.typed:
                    key_args = tuple( ( (v, type(v)) for v in args ) )
                    key_kwargs = tuple( ( (k, v, type(v)) for (k, v) in sorted(kwds.items()) ) )
                else:
                    key_args = tuple( (v for v in args) )
                    key_kwargs = tuple( ( (k, v) for (k, v) in sorted(kwds.items()) ) )
                key = (key_args, key_kwargs)
                if key in self.cache:
                    self.hits += 1
                    val = self.cache.pop(key)
                    self.cache[key] = val
                    return val
                else:
                    self.misses += 1
                    result = self.user_function(*args, **kwds)
                    self.cache[key] = result
                    if len(self.cache) > self.maxsize:
                        self.cache.popitem(last=False)
                    return result
        return LRUWrapper()
    return decorating_function

def lfu_cache(maxsize=128, typed=False):
    def decorating_function(user_function):
        CACHE = {}
        class TimestampHolder:
            def __init__(self):
                self.value = 0
        last_timestamp = TimestampHolder()

        def wrapper(*args, **kwds):
            key_parts = []
            for a in args:
                if typed:
                    key_parts.append((type(a), a))
                else:
                    key_parts.append(a)
            for k, v in sorted(kwds.items()):
                if typed:
                    key_parts.append((k, (type(v), v)))
                else:
                    key_parts.append((k, v))
            key = tuple(key_parts)

            current_ts = last_timestamp.value
            if key in CACHE:
                val, freq, ts = CACHE[key]
                new_freq = freq + 1
                new_ts = current_ts
                CACHE[key] = (val, new_freq, new_ts)
                last_timestamp.value += 1
                return val
            else:
                result = user_function(*args, **kwds)
                if len(CACHE) >= maxsize:
                    min_freq = float('inf')
                    min_ts = float('inf')
                    evict_key = None
                    for k in CACHE:
                        val, freq, ts = CACHE[k]
                        if freq < min_freq or (freq == min_freq and ts < min_ts):
                            min_freq = freq
                            min_ts = ts
                            evict_key = k
                    del CACHE[evict_key]
                CACHE[key] = (result, 1, current_ts)
                last_timestamp.value += 1
                return result
        return wrapper
    return decorating_function

